import { get } from "react-scroll/modules/mixins/scroller";
import "./SucculentComponent.css";
const images = require.context('./', true);

function getRandomInt(max) {
  return Math.floor(Math.random() * max);
}

function SucculentComponent() {
  return (
  <>
  <div className="succulent-container">
    {[...Array(12),].map((value, index) => (
      <img className="succ-image" style={{left: 10}} src={images(`./succ${getRandomInt(4) + 1}.png`)} alt="succ1" width="10%"/>
    ))}
  </div>
  </>
  );
}

export default SucculentComponent;
